import React from 'react';
import PageNavBar from './PageNavBar';
import './Page.css';
import { topics } from './Topics';
import { pages } from './Pages';

function Page({ unit, index, title }) {
    let currPage, pageList, topicList;
    if (unit - 1 < pages.length && index - 1 < pages[unit - 1].length){
        currPage = pages[unit - 1][index - 1];
        pageList = pages[unit - 1];
        topicList = topics[unit - 1];
    }
    else{
        currPage = <p>Page does not exist :(</p>;
    }

    return (
        <div className="page">
            <PageNavBar currIndex={currPage} pageList={pageList} topics={topicList}/>
            <h3>{title}</h3>
            {currPage}
        </div>
    )
}
export default Page;
